    "Hybrid High-Temperature Superconductor Current Leads for Space Applications Project",nt"tracking_summary":
    {ntt"total": 6,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T00:55:53.561321",nt"name": "hybrid-high-temperature-superconductor-current-leads-for-space-applications-project-91fcf",nt"isopen":
    true,nt"url": null,nt"notes": "The Tai-Yang Research Company (TYRC) proposes
    to address the need for high temperature superconducting (HTS) current leads used
    in an adiabaticrndemagnetization refrigerator (ADR) for space applications, presently
    being developed at the NASA / Goddard Space Flight Center (GSFC). The innovation
    is to use a hybrid of two different HTS conductors bonded together at a thermally
    and electrically determined optimum point along the length of the current lead.
    rnrnThe HTS conductor positioned at the warm end of the current lead will have a
    higher critical temperature (Tc) than the conductor at the cold end.  This hybrid
    lead uses commercially available 2nd generation HTS conductors optimized for currents
    less than 10A.  The warm end Tc is extended by using a bulk or thin film form not
    yet commercially available.  TYRC will custom-fabricate the higher Tc materials
    and develop processes for joining them to the lower Tc material.  TYRC will develop
    fabrication processes and generate options for mechanical design of the lead assembly.rn",nt"license_title":
